import React from 'react';
import { Breadcrumb, Layout, Menu, theme } from 'antd';
import {Routes, Route, useNavigate} from 'react-router-dom';
import Body from './Body/BodyRegister';

const { Header, Footer } = Layout;

const App: React.FC = () => {  
  const {
    token: { colorBgContainer },
  } = theme.useToken();



  const navigate = useNavigate();

  return (
    <Layout className="layout">
        <div className="logo" />
        <Menu
        onClick={({key})=>{
          navigate(key)

        }}
          theme="dark"
          mode="horizontal"
          items={[
            {label: "Cadastro", key: "/register",},
            {label: "Listagem", key: "/list"},
            {label: "Deletar", key: "/delete"},
            {label: "Atualizar", key: "/update"}
          ]}
        ></Menu>
        <Content/>
      <Footer style={{ textAlign: 'center' }}>Ant Design Â©2018 Created by Ant UED</Footer>
    </Layout>
  );
};

function Content(){
  return <div>
    <Routes>
      <Route path="/register" element={<div>teste</div>}></Route> 
      <Route path="/list" element={<div>hola</div>}></Route>
    </Routes>
  </div>
}

export default App;
